    const {title,id} = props.CardViewData


    return(
    <div style={{boxShadow:"5px 5px 5px grey"}}>
        <div className="card" style={{width:"13rem"}} >
        <img src={reactJS} className="card-img-top" alt="..." onClick={(e) => {navigation(`${id}`, {state:{key:{id}}})}}/>
        <div className="card-body">
            <h5 className="card-title">{title}</h5>
        </div>
        </div>
    </div>
  );
};

export default Card;
